import React from 'react';
import { StyleSheet, TextIn, View } from 'react-native';
import ResultTableBase from './ResultTableBase';

function Cell({value, index}) {
    return (
      <View>
        <TextInput 
            name={index}
            value={value}
            keyboardType="numeric"
        />
      </View>
    )
  }

export default function ResultTableForm() {
    return (
        <ResultTableBase
            color="gray"
            renderCell={(value, index) => <Cell value={value} key={index} />}
        />
    )
}

  const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
    },
    header: {

    }
  });
